import React from "react";
import "./ToolFooter.scss";

function ToolFooter() {
    return (
        <div className="toolFooterWrapper">
            <div className="footerContentWrapper">
                <div className="companyTitle">
                    <span>(주) 제로투원파트너스</span>
                </div>
                <div className="phoneItem"></div>
                <div className="phoneItem"></div>
                <div className="phoneItem"></div>
                <div className="phoneItem"></div>
            </div>
            <div className="toolWrapper">
                <div className="toolItem">전화</div>
                <div className="toolItem">홈페이지</div>
                <div className="toolItem">찾아오기</div>
                <div className="toolItem">공유</div>
            </div>
        </div>
    );
}

export default ToolFooter;
